INSERT INTO "candidates" VALUES(26,'Bobby Forch','Current: Seattle Department of Transportation, Contracting Equity and Compliance Manager, helping small businesses with the city''s contracting processes
INSERT INTO "candidates" VALUES(27,'Jean Godden','Current: Member of Seattle City Council since 2004.
INSERT INTO "candidates" VALUES(28,'Bruce Harrell','Bruce A. Harrell (born 1958) is currently serving as a member of the Seattle City Council. He was first elected in 2007 from a field of five candidates. He is currently Chair of the Energy, Technology, and Civil Rights Committee and is responsible for oversight of Seattle City Light, the city''s public power utility and the city''s Department of Information and Technology. Harrell is Vice Chair of Public Utilities & Neighborhoods and member of Parks & Seattle Center. He sits on the Executive Board for the Puget Sound Regional Council and is a member of the Puget Sound Regional Transportation Policy Board. Bruce Harrell also sits on the King County Flood Control Zone Advisory Committee and the Fire Facilities Oversight Committee.','http://www.edgeonthenet.com/display/viewimage_story.php?id=119836','http://www.electbruceharrell.com','bruceharrell2011@gmail.com',NULL,'bruceharrell','http://www.facebook.com/bruceharrell','2011-11-04 07:29:58.741664','2011-11-04 07:29:58.741664',13,'5555555555','t');
INSERT INTO "candidates" VALUES(29,'Brad Meacham','Brad is a third-generation Washingtonian who has always been deeply engaged in Seattle - following key civic issues and voting absentee even while he lived abroad. He served on the board of the Municipal League of King County for three years and was elected chairman twice. He is currently in his fifth year on the board of Richard Hugo House and has also been a member of the Eastlake Community Council. In addition, he recently completed a Master of Public Administration (M.P.A.) degree from the Evans School at the University of Washington.','http://seattletransitblog.com/wp-content/uploads/2011/07/meacham.png','http://www.electbradmeacham.com','info@electbradmeacham.com',NULL,'bradmeacham','http://www.facebook.com/electbradmeacham','2011-11-04 07:29:58.749522','2011-11-04 07:29:58.749522',13,'5555555555','f');
INSERT INTO "candidates" VALUES(30,'Dale L. Pusey','Dale Pusey is a 32 year-old accountant and West Seattleite running for Seattle City Council Position 5 as the sole challenger against two-term incumbent Tom Rasmussen. Johnathon Fitzpatrick spoke to him for seattlepi.com and Pusey discussed his beef with the Council on transit and his idea to preserve the Alaskan Way Viaduct as a park.','http://www.dalepusey.com/images/dale2.jpg','http://www.dalepusey.com','dale.pusey@clearwire.net',NULL,'dalepusey','http://www.facebook.com/pages/People-for-Dale-Pusey/210451178991456','2011-11-04 07:29:58.757494','2011-11-04 07:29:58.757494',14,'5555555555','f');
INSERT INTO "candidates" VALUES(31,'Tom Rasmussen','Tom Rasmussen is a member of the Seattle City Council, first elected in 2003. Between September 2004 and December 2007 he was chair of the Housing, Human Services & Health Committee, vice chair of the Urban Development & Planning Committee, and a member of the Transportation Committee. On January 7, 2008 Tom was sworn in for his second term on City Council. From January 2008 through December 2009, he was chair of the Parks & Seattle Center Committee, the vice chair of the Culture, Civil Rights, Heath and Personnel Committee, and the Labor Policy Committee. He is currently chair of the Transportation Committee, vice chair of the Parks and Seattle Center Committee, and a member of the Housing, Human Services, Health, and Culture Committee.','http://tom4seattle.com/images/uploaded/bio.jpg','http://tom4seattle.com/','info@tom4seattle.com',NULL,'Tom4Seattle','http://www.facebook.com/pages/Tom-Rasmussen-for-Seattle-City-Council/133544566715511','2011-11-04 07:29:58.765947','2011-11-04 07:29:58.765947',14,'5555555555','t');
INSERT INTO "candidates" VALUES(32,'Tim Burgess','Tim Burgess is a member of the Seattle City Council, former journalist, Seattle Police Department detective and international humanitarian worker. Burgess was elected in November, 2007 with 64% of the vote. He assumed office on January 1, 2008 and his term expires December 31, 2011. Burgess chairs the Public Safety and Education Committee and co-chairs the Built Environment Committee, Domestic Violence Prevention Council and the Family and Education Levy Oversight Committee. Prior to his election to the City Council, Burgess chaired his neighborhood community council and served 12 years on Seattle''s Ethics and Elections Commission.','http://electtimburgess.com/images/tim-head.jpg','http://www.electtimburgess.com/','info@electtimburgess.com',NULL,'ElectTimBurgess','http://www.facebook.com/pages/Elect-Tim-Burgess/151303868270933','2011-11-04 07:29:58.774259','2011-11-04 07:29:58.774259',15,'5555555555','t');
INSERT INTO "candidates" VALUES(33,'David L. Schraer','My name is David Schraer and I am running for Seattle City Council position seven. An architect, small business owner, community development professional and long-time political activist, I will bring unique perspective to the council which can be summarized as short-term pragmatism coupled with long-term idealism. Here is my story.','https://lh5.googleusercontent.com/-BjFGERGrSbI/AAAAAAAAAAI/AAAAAAAAAYY/g7VO9DuOZz4/photo.jpg','http://davidforseattle.com/','david@inplainair.com',NULL,'','http://www.facebook.com/pages/David-For-Seattle/225560587477278?sk=wall','2011-11-04 07:29:58.782945','2011-11-04 07:29:58.782945',15,'5555555555','f');
INSERT INTO "candidates" VALUES(34,'Sally Clark','Sally J. Clark is a member of the Seattle City Council, appointed to fill the vacant seat formerly occupied by Jim Compton in January 2006. She was elected to a one-year term in November 2006 and a four year term in 2007. Clark chairs the Planning, Land Use, and Neighborhoods committees. She used to be a legislative aide to former City Councilwoman Tina Podlodowski, and worked as a legislative aide to King County Councilmember Bob Ferguson before joining Lifelong AIDS Alliance as director of community resources. At Lifelong AIDS Alliance Sally oversaw public policy and advocacy, HIV prevention education, volunteer recruitment and training, and insurance premium payment assistance. Clark was an editor for the Seattle Gay News and has written for The Advocate. She is an open lesbian.','http://wpcnet.org/end_uploads/sally_clark.jpg','http://electsallyclark.com/','info@electsallyclark.com',NULL,'sally4council','http://www.facebook.com/votesally','2011-11-04 07:29:58.791129','2011-11-04 07:29:58.791129',16,'5555555555','t');
INSERT INTO "candidates" VALUES(35,'Dian Ferguson','My vision is of a Seattle where everyone belongs, and where no individual and no neighborhood is left behind. It is a place where small businesses thrive, and where children and youth are well-educated. In my vision public safety is front and center, police are accountable to the public as public servants, and we have a commitment to that larger something which comes through shared effort and mutual benefit. I am up for the challenge. My skills, knowledge and experience set me apart from the business-as-usual conversations and solutions that dominate Seattle City Council. This is why I have decided to run. I need your support through dollars, time, endorsements, commitment and prayers to change the course of Seattle''s current direction.','http://hphotos-sea1.fbcdn.net/hphotos-snc6/231196_160441710686186_154297187967305_382078_8147866_n.jpg','http://www.dianferguson.com/','logan@dianferguson.com',NULL,'electdian','http://www.facebook.com/pages/Elect-Dian-Ferguson/154297187967305','2011-11-04 07:29:58.800049','2011-11-04 07:29:58.800049',16,'5555555555','f');
