INSERT INTO "posts" VALUES(39,'With last night’s endorsement by the 43rd District Democrats, I have achieved what no other challenger has before in a City of Seattle election – I have been endorsed by every single Democratic Legislative District in the city of Seattle.
INSERT INTO "posts" VALUES(40,'"Sierra Club supports Bobby Forch for Seattle City Council. He has pledged to make public transit, a crucial issue in Seattle, the focus of his environmental agenda if elected, and has a strong plan to advocate for dependable, sustainable transit funding and service. Mr. Forch speaks passionately about the connections between environmental issues and social justice, and understands the need to base policy decisions on considerations of both. Mr. Forch''s opponent in the race...has not been a strong advocate for the environment, and the Club believes it is time for a change. Vote Bobby Forch for Seattle City Council position 1."
