INSERT INTO "posts" VALUES(76,'As budget chair, I''ve increased the transparency and accessibility of the budget process.  The 2012 budget process begins this week - find out how you can be involved.','facebook',NULL,'http://jeangodden.com/blog/2011/09/seattles-2012-budget-transparent-and-accessible/','Seattle''s 2012 budget: transparent and accessible. | Blog | ReElect Jean Godden Seattle City Council','jeangodden.com','https://s-static.ak.facebook.com/rsrc.php/v1/yD/r/aS8ecmYRys0.gif',NULL,'176845245692288_194999300571963','One of my main initiatives as the council’s Budget Chair has been increasing the transparency and accessibility of the budget process. I believe that public input is critical to a successful outcome, especially in these years when we are continually making tough choices.','f','f','2011-09-21 17:22:21.000000','Reelect Jean Godden','176845245692288',27,'2011-11-04 07:37:42.548257','2011-11-04 07:37:42.548257');
