INSERT INTO "posts" VALUES(84,'On Monday, September 12, Seattle is poised to become the 4th city in the country to pass paid sick days legislation, in addition to the entire State of Connecticut.','facebook',NULL,'http://jeangodden.com/blog/2011/09/why-i-support-paid-sick-leave/','Why I support Paid Sick Leave (and cosponsored the bill) | Blog | ReElect Jean Godden Seattle City C','jeangodden.com','https://s-static.ak.facebook.com/rsrc.php/v1/yD/r/aS8ecmYRys0.gif',NULL,'176845245692288_197562800309804','When I was a restaurant critic, I always noticed that our great restaurants and chefs treated their wait staff as if they were family – and most of them do today. But I have been out to dinner when I have been served by wonderful women who just could not take the night off even though they were sick...','f','f','2011-09-09 15:36:36.000000','Reelect Jean Godden','176845245692288',27,'2011-11-04 07:37:42.753214','2011-11-04 07:37:42.753214');
