INSERT INTO "posts" VALUES(284,'DIAN ON THE ISSUES - Retire Sally Clark
INSERT INTO "posts" VALUES(285,'The last Candidate Forum sponsored by the the League of Young Voters was filled with young people complete with diversity, great food, hip hop music, video, thoughtful questions and lots of interaction.  It was full of passion and very results oriented.  This was the perfect way to end the final Candidate Forum.  The School Board Candidates challenging the incumbents have a great rapor with each other. I actually think they have the skills, drive, determination, passion and results focused energy to close the achievement gap and raise the graduation percentages.  My mentor fresh from Kenya, Dawn Mason was there asking everyone hard questions and offering commentary.  It was great to have her present!','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_228751743855182',NULL,'f','f','2011-11-04 07:38:05.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.457986','2011-11-04 16:23:59.457986');
INSERT INTO "posts" VALUES(286,'What a wonderful day it was on Thursday.  I dined at Luna Cafe with volunteers prior to heading out to the West Seattle Bridge Over Pass waving to afternoon commuters and saying hi.  Thank you Mikhail, Zhalena, Diana, and all of the kids.  It was a wonderful time.  Lots of car honking and waves from the West Seattle commuters.','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_228750670521956',NULL,'f','f','2011-11-04 07:31:00.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.486479','2011-11-04 16:23:59.486479');
INSERT INTO "posts" VALUES(287,'As part of its coverage of local political races, KUOW’s popular Weekday program will be interviewing me and opponent Sally Clark on Friday morning. Host Steve Scher’s conversation with begins at 9:30 on 94.9 FM. It will be one of the last chances voters have to hear, and ask questions, of either of us before ballots are due to be mailed next Tuesday.
INSERT INTO "posts" VALUES(288,'Phone banking really can be fun.  It is good to speak with people and to learn what really sets them off and what they feel passionately about.  Wrong priorities, wastefulness, and not being listen to keeps coming up with those to whom I speak.','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_228499587213731',NULL,'f','f','2011-11-03 18:31:57.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.517981','2011-11-04 16:23:59.517981');
INSERT INTO "posts" VALUES(289,'I am looking forward to the We Are the 99% Young Voters League Candidate Forum this evening.  The School Board Candidates will start it off at 7:00 PM followed by the Seattle City Council Candidates at 8:00 PM, Monica''s Village Place, 140 23rd, Seattle, 98122.  It has been a while since we were all together in one place School Board and Seattle City Council.','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_228498730547150',NULL,'f','f','2011-11-03 18:29:57.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.533158','2011-11-04 16:23:59.533158');
