INSERT INTO "posts" VALUES(291,'On Thursday afternoon, 3 PM - 5 PM we will be bannering and campaigning at the West Seattle Bridge over pass.  This is a wonderful opprotunity for the West Seatttle, Southeast Seattle and our friends in White Center and Burien to come out and be with us.  Yes, I know White Center and Burien is not a part of Seattle, however, I still have friends who reside there.  I am thankful for friendships.','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_228095953920761',NULL,'f','f','2011-11-02 19:28:28.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.581975','2011-11-04 16:23:59.581975');
INSERT INTO "posts" VALUES(292,'The League of Young Voters is hosting a Candidate Froum on Thursday evening. I believe this to be the last Candidate Forum prior to the election. The information for the Candidate Forum is as follows:  Monica''s Village Place, Community Rm., 140 23rd, Seattle, 98122, November 3rd, 6 PM - 9 PM.  Hope to see you there!','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_228085957255094',NULL,'f','f','2011-11-02 19:06:55.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.596613','2011-11-04 16:23:59.596613');
