INSERT INTO "posts" VALUES(296,'I just read that only around 10% of the ballots have been returned.  This means every effort must be made to engage voters through phone banking, bannering and reminding them how important voting really is.  Another friend just told me that she did not have a stamp to mail in her ballot, however, she was on her way to get one.  Call the campaign to help GOTV.','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_227618447301845',NULL,'f','f','2011-11-01 17:38:36.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.668943','2011-11-04 16:23:59.668943');
