INSERT INTO "posts" VALUES(303,'Today I will be speaking to several groups first at Yesler Terrace and later this evening in North Seattle. Between the hours it will be more GOTV. Time is short to contact as many voters as possible prior to them sending in their ballots for me. I feel the love.','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_225959087467781',NULL,'f','f','2011-10-28 18:09:12.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.777814','2011-11-04 16:23:59.777814');
