INSERT INTO "posts" VALUES(306,'If you have not done any phone banking you really are missing out on an opportunity to learn what people are thinking. I have been phone banking for the past three days to those voters with the perfect voting records. Many of these individuals are 70 + in age. I spoke with a fellow who was 100 yesterday. He had youthful energy. Some have sent their ballots in others have indicated that they would not be voting this time around because nothing ever changes anyway. I have heard an ear full about bad roads, no side walks, and too many bike lanes in the wrong places. One person invited me over for tea and others just hung up on me.  It all makes life interesting. Who wants to phone bank?','facebook',NULL,NULL,NULL,NULL,NULL,NULL,'154297187967305_225564390840584',NULL,'f','f','2011-10-27 19:32:42.000000','Elect Dian Ferguson','154297187967305',35,'2011-11-04 16:23:59.822257','2011-11-04 16:23:59.822257');
